import { StyleHamburguer } from "./style";

const Hamburguer = () => {
  return (
    <StyleHamburguer>
      <div>
        <div></div>
        <span>Laudemir</span>
      </div>
      <div>
        <p></p>
      </div>
      <div></div>
    </StyleHamburguer>
  );
};

export default Hamburguer;
